B.GJ=new A.ka("Renewable Energy No. 2","Solar Energy","Bubenreuth, Deutschland","Solar energy captures sunlight and converts it into electricity or heat using photovoltaic (PV) panels or solar thermal collectors. PV panels, made from semiconductor materials like silicon, generate electricity when exposed to sunlight. Solar thermal systems use mirrors or lenses to concentrate sunlight, producing heat that can generate electricity or be used directly for heating. Solar energy is abundant, widely available, and generates no emissions during operation, making it an essential component of the renewable energy landscape.",B.A6,"https://images.unsplash.com/photo-1625301840055-7c1b7198cfc0?q=80&w=1471&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D",null)
B.A7=new A.A(4291552908)
B.GN=new A.ka("Renewable Energy No. 3","Hydro Energy","Marion County, Oregon","Hydro energy, or hydropower, generates electricity by harnessing the energy of flowing or falling water. Dams or run-of-river systems are commonly used to capture this energy. In a dam-based system, water stored in a reservoir is released to flow through turbines, generating electricity. Run-of-river systems utilize the natural flow of rivers without large reservoirs. Hydropower is a reliable and efficient renewable energy source, capable of providing large-scale power generation and grid stability. It also offers benefits such as flood control, irrigation support, and water supply.",B.A7,"https://images.unsplash.com/photo-1561533115-f893e69758e9?q=80&w=1374&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D",null)
B.Ac=new A.A(4293442181)
B.GK=new A.ka("Renewable Energy No. 4","Geothermal Energy","Grand Prismatic Spring, Wyoming, USA","Geothermal energy utilizes heat from the Earth's interior to generate electricity and provide heating. This heat originates from the Earth's core and the decay of radioactive materials in the crust. Geothermal power plants typically use steam produced from geothermal reservoirs to drive turbines and generate electricity. Geothermal energy is a stable and reliable source of power, capable of providing baseload electricity with minimal environmental impact. It is available 24/7, unaffected by weather conditions, making it a valuable complement to other renewable energy sources.",B.Ac,"https://images.unsplash.com/photo-1629985692760-0683f26733e2?q=80&w=1470&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D",null)
